import React from "react";
import Header from "../Header";
import Footer from "../Footer";
import "../css/main.css";
import CVImporting from "./CVImporting";
import Match from "./Match";
import JobDescription from "./JobDescription";
import Result from "./Result";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogContentText,
  DialogActions,
} from "@mui/material";
import { useSelector, useDispatch } from "react-redux";
import { click, get_matching_data } from "../slices/matchSlice";
import resumeData from "../data/resume.json";

function HomePage() {
  const { isMatched, matchingData } = useSelector(
    (state) => state.matchReducer
  );
  const dispatch = useDispatch();

  const handleClick = () => {
    dispatch(click(isMatched));
  };

  // console.log("resume keys: ", Object.keys(resumeData));
  const jsonOb = {
    candidate_name: "DUONG PHUC HAU",
    candidate_phone: "0877757745",
    certification_comment:
      "Candidate does not have the required Certified Business Analysis Professional (CBAP) certificate.",
    certification_score: "0",
    cv_name: ".DUONG_PHUC_HAU_FresherJava",
    education_comment:
      "Candidate does not have a Bachelor's degree in Business Administration, Finance, or Economics.",
    education_score: "0",
    experiment_comment:
      "Candidate has some experience as a business analyst and in data analysis and reporting.",
    experiment_score: "50",
    job_name: "Sample business analyst job description",
    recommended_jobs:
      "['Back-End Developer', 'Full-Stack Developer', 'Java Developer']",
    responsibilities_comment:
      "Candidate has some responsibilities that are relevant to the position.",
    responsibilities_score: "20",
    soft_skills_comment:
      "Candidate has good communication skills and the ability to work in a team.",
    soft_skills_score: "75",
    technical_skills_comment:
      "Candidate has some technical skills relevant to the position.",
    technical_skills_score: "50",
  };

  return (
    <div className="homepage-container">
      <Header />
      <div className="homepage-body">
        <CVImporting />
        <Match />
        <JobDescription />
        <Dialog open={isMatched}>
          <DialogTitle>RESUMÃ‰/CV SUMMARY</DialogTitle>
          <DialogContent className="cv-summary-dialog-content-custom">
            <DialogContentText>
              {/* {matchingData ? JSON.stringify(matchingData) : ""} */}
              {jsonOb.map((prop) => {
                return <li>{prop}</li>;
              })}
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <button className="btn btn-danger" autoFocus onClick={handleClick}>
              Close
            </button>
          </DialogActions>
        </Dialog>

        {/* <Result /> */}
      </div>
      <Footer />
    </div>
  );
}

export default HomePage;
